<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        #map {
            width: 1620px;
            height: 891px;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[42.209261949780746,-71.93875819386315],[42.34597235211582,-71.60247194207328]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var autolinker = new Autolinker({truncate: {length: 30, location: 'smart'}});
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        map.createPane('pane_Stamen2_0');
        map.getPane('pane_Stamen2_0').style.zIndex = 400;
        var layer_Stamen2_0 = L.tileLayer('https://stamen-tiles-{s}.a.ssl.fastly.net/toner/{z}/{x}/{y}.png', {
            pane: 'pane_Stamen2_0',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 18
        });
        layer_Stamen2_0;
        map.addLayer(layer_Stamen2_0);
        map.createPane('pane_Afternoon_Areawide_Worcester_1');
        map.getPane('pane_Afternoon_Areawide_Worcester_1').style.zIndex = 401;
        var img_Afternoon_Areawide_Worcester_1 = 'data/Afternoon_Areawide_Worcester_1.png';
        var img_bounds_Afternoon_Areawide_Worcester_1 = [[42.1849339002884,-71.91874802378014],[42.36708463351909,-71.69480019498425]];
        var layer_Afternoon_Areawide_Worcester_1 = new L.imageOverlay(img_Afternoon_Areawide_Worcester_1,
                                              img_bounds_Afternoon_Areawide_Worcester_1,
                                              {pane: 'pane_Afternoon_Areawide_Worcester_1'});
        bounds_group.addLayer(layer_Afternoon_Areawide_Worcester_1);
        map.addLayer(layer_Afternoon_Areawide_Worcester_1);
        setBounds();
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        </script>
    </body>
</html>
